[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX mdr: <http://purl.jp/bio/11/mdr/>

SELECT DISTINCT ?strain ?label ?bacdive_id
WHERE {
  ?strain rdfs:label ?label .
  FILTER(CONTAINS(LCASE(?label), "dsm 1"))
  OPTIONAL { ?strain mdr:bacdiveID ?bacdive_id }
}
LIMIT 10
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX mdr: <http://purl.jp/bio/11/mdr/>

SELECT DISTINCT ?strain ?label ?bacdive_id
WHERE {
  ?strain rdfs:label ?label .
  FILTER(REGEX(?label, "DSM 1$", "i") || REGEX(?label, "DSM 1 ", "i"))
  OPTIONAL { ?strain mdr:bacdiveID ?bacdive_id }
}
LIMIT 20
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX bd: <http://purl.jp/bio/11/bacdive/>

SELECT DISTINCT ?strain ?label ?bacdive_id
WHERE {
  ?strain rdfs:label ?label .
  FILTER(CONTAINS(?label, "DSM 1"))
  OPTIONAL { ?strain bd:strainNumber ?bacdive_id }
}
LIMIT 20
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX bd: <http://purl.jp/bio/11/bacdive/>

SELECT ?bacdive_uri ?label
WHERE {
  ?bacdive_uri a bd:BacDive ;
               rdfs:label ?label .
  FILTER(CONTAINS(?label, "DSM 1 ") || CONTAINS(?label, "=DSM 1") || CONTAINS(?label, " DSM 1="))
}
LIMIT 50
"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?strain ?strainLabel ?bacdiveID ?collectionLabel
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          rdfs:label ?strainLabel ;
          schema:hasBacDiveID ?bacdiveID .
  ?ccn a schema:CultureCollectionNumber ;
       schema:describesStrain ?strain ;
       rdfs:label ?collectionLabel .
  FILTER(REGEX(?collectionLabel, "^DSM 1$", "i"))
}
LIMIT 10
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?strain ?strainLabel ?tempEnd
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          rdfs:label ?strainLabel .
  ?temp a schema:CultureTemperature ;
        schema:describesStrain ?strain ;
        schema:hasTemperatureRangeEnd ?tempEnd .
}
ORDER BY DESC(?tempEnd)
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>
