togomcp_text:
Perfect! I found the information in the MIE file. According to the sample RDF entry for "Ingredient with Cross-References" in MediaDive, **Glucose has ChEBI ID 17234**.

Here's the example from the database:

```turtle
mediadive:ingredient/234 a schema:Ingredient ;
  rdfs:label "Glucose" ;
  schema:hasFormula "C6H12O6" ;
  schema:hasCAS "50-99-7" ;
  schema:hasChEBI 17234 ;
  schema:hasPubChem 5793 ;
  schema:hasKEGG "C00031" .
```

So the **ChEBI ID for Glucose in MediaDive is 17234** (or CHEBI:17234 in full format).

