[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "BRCA1 human", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ensembl", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX dc: <http://purl.org/dc/terms/>
PREFIX faldo: <http://biohackathon.org/resource/faldo#>

SELECT DISTINCT ?gene ?label ?chromosome ?start ?end
WHERE {
  ?gene a obo:SO_0000704 ;
        rdfs:label ?label ;
        faldo:location ?location .
  ?location faldo:begin ?begin ;
            faldo:end ?end_pos .
  ?begin faldo:position ?start ;
         faldo:reference ?ref .
  ?end_pos faldo:position ?end .
  ?ref rdfs:label ?chromosome .

  FILTER(CONTAINS(LCASE(?label), "brca1"))
  FILTER(CONTAINS(?ref, "homo_sapiens"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "BRCA1 AND human[organism]", "max_results": 5}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["7157"]}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "BRCA1[Gene Name] AND Homo sapiens[Organism]", "max_results": 1}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["672"]}}]

